// GroupDetailPage.js

import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom'; // Import useParams to access route parameters
import Axiosinstance from '../../config/Axiosinstances';

function GroupDetailPage() {
    const { groupId } = useParams(); // Extract groupId from URL params
    const [group, setGroup] = useState(null);

    useEffect(() => {
        fetchGroupDetails();
    }, []);

    const fetchGroupDetails = () => {
        Axiosinstance.get(`/users/groups/${groupId}`)
            .then(response => {
                setGroup(response.data);
            })
            .catch(error => {
                console.error('Error fetching group details:', error);
            });
    };

    if (!group) {
        return <div>Loading...</div>; // Add loading indicator while data is being fetched
    }

    return (
        <div>
            <h1>Group Details</h1>
            <h2>Group Name: {group.groupName}</h2>
            <h3>Group ID: {group._id}</h3>
            <p>Other group details...</p>
        </div>
    );
}

export default GroupDetailPage;
